$(document).ready(function(){$("#nyt-feed-selection").on("change",function(){var t="https://api.nytimes.com/svc/topstories/v2/"+$(this).val()+".json";t+="?"+$.param({"api-key":"7331fe55c27e461991e92be4dea1b870"}),$.ajax({url:t,method:"GET"}).done(function(t){$(".stories-list").empty();for(var e=0,s=0;s<t.results.length&&e<12;s++)if(3<t.results[s].multimedia.length){var r=t.results[s].multimedia[4].url,a=t.results[s].url,i=t.results[s].abstract;$(".stories-list").append('<li class="story-list-item"><a href="'+a+'" target="_blank" class="story-item" style="background: url('+r+') no-repeat center/cover"><p class="story-item-text">'+i+"</p></a></li>"),e+=1}}).fail(function(t){throw t})})});